import { SPageListProps } from 'servisofts-component';
import Ajustes from './template_001/Ajustes';
import Camara from './template_001/Camara';
import Chats from './template_001/Chats';
import Estados from './template_001/Estados';
import Llamadas from './template_001/Llamadas';
import Test2 from './template_002/Test';


import experiencia from './admin/experiencia';
import login from './admin/login';
import proyecto from './admin/proyecto';
import root from './root';



const Pages: SPageListProps = {

    "/": root,
    // ...Services.Pages,

    "camara": Camara,
    "ajustes": Ajustes,
    "chats": Chats,
    "estados": Estados,
    "llamadas": Llamadas,
    "test2": Test2,

    "login": login,
    "admin/proyecto": proyecto,
    "admin/experiencia": experiencia,
    // "admin/experiencia": experiencia,
    // ...Chat.Pages,
    // ...Usuario.Pages,


}


export const Reducer = {
    // ...Usuario.Reducers,
    // ...Chat.Reducers,
}

export default Pages;
